import React from 'react';
import styled from 'styled-components';
import {SectionTitle} from '../../../components/SectionTitle';
import {FlexWrapper} from '../../../components/FlexWrapper';
import photo from '../../../assets/1B7A6452.webp';
import {theme} from '../../../styles/Theme';

export const Helps = () => {
    return (
        <StyledHelps>
            <SectionTitle>Чем могу помочь</SectionTitle>
            <FlexWrapper justify={"space-between"} align={"center"} gap={"5%"}>
                <PhotoWrapper>
                    <Photo src={photo} alt={""}/>
                </PhotoWrapper>
                <StyledContent>

                </StyledContent>
            </FlexWrapper>

        </StyledHelps>
    );
};

const StyledHelps = styled.section`
    width: 80%;
    min-height: 100vh;
    height: fit-content;
    ${FlexWrapper}{
    border: 1px solid;
    }
`;
const PhotoWrapper = styled.div`
position: relative;
z-index: 0;

    &::before {
        content: "";
        width: 250px;
        height: 375px;
        background-color: ${theme.colors.colorGray};
        position: absolute;
        top: -10px;
        left: -10px;
        z-index: -1;

    }
`;
const Photo = styled.img`
    max-width: 300px;
    height: auto;
    width: 100%;
    object-fit: cover;
`;
const StyledContent = styled.div`
`;
